import React from 'react'
import './Videos.css'

function Videos(props) {
  const {imagen,color} = props
console.log(color)

  return (
     <img style={{border:`9px solid red`}} 
     className='videos' src={imagen} 
     alt='imagen'/>
  )
}

export default Videos
